     (SELECT COUNT(*) FROM Student s JOIN Renting r ON s.Student_ID = r.Student_ID WHERE r.Room_ID IN (SELECT Room_ID FROM Room WHERE Dorm_ID = d.Dorm_ID)) AS Total_Students,
